import { useState } from 'react'
import customer from "./Customer.js"

const LoginCustomer = () => {
	const [username, setUsername] = useState('')
    const [password, setPassword] = useState('')
	const [errorField, setErrorField] = useState([])

	const onClickSave = async () =>
	{
		const res = await customer.create(username,password)
		console.log(username)
		console.log(password)
		if (res.success) {
			alert(res.message)
			console.log(res);
		}
		else if (res.status==400) {
			console.log(res.message);
			const dataError = []
			const error = res.data.errors

			if (error) {
				error.map((itemerror)=>{
					console.log(itemerror.defaultMessage);
					dataError.push(itemerror.defaultMessage)
				})
				setErrorField(dataError)
			}
			else {
				dataError.push(res.data.message)
				setErrorField(dataError)
			}
		}
		else {
			console.log(res);
			const dataError = []
			dataError.push(res.message);
			setErrorField(dataError)
		}
		
	};
    return (
		<div className='container'>
		<h1>Welcome to DocApp!</h1>
		<form className="add-form">
			<div className="form-control">
				<label> Email </label>
				<input  type="text"
						placeholder="Enter email" value={username} onChange={(e) => setUsername(e.target.value)} />
			</div>
			<div className="form-control">
				<label> Password </label>
				<input type="password" placeholder="Enter password" value={password} onChange={(e) => setPassword(e.target.value)}/>
			</div>
			</form>
				{
					errorField.map((itemerror)=>{
						return(
							<p >*{itemerror}</p>
						)
					})
				}

				<div>
				
		      	<button onClick={(e) => onClickSave(e)} class="btn btn-primary btn-block" type="submit">Save</button>
				
				</div>
      </div>
    )
};



export default LoginCustomer
